        "vaeua-gui-eua.sas.van.Insights.outliers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Ustalenie dotyczące <span class\\="xis-windowItem">Wartości odstających</span> identyfikuje elementy danych w raporcie, na które mogą mieć wpływ wartości odstające. </p><p class\\="xis-paragraph">Aby wyświetlić analizę wartości odstających dla miary, kliknij <span data-icon-name\\="information" alt\\="Ikona informacji" aria-label\\="Ikona informacji"></span> obok miary, a następnie kliknij <span class\\="xis-windowItem">Wyświetl analizę wartości odstających</span> w okienku wyskakującym.</p><p class\\="xis-paragraph">Aby zobaczyć wpływ wartości odstających na obiekty w raporcie, kliknij <span class\\="xis-windowItem">Analizuj obiekty pod kątem wpływu</span>. Po zakończeniu analizy kliknij <span class\\="xis-windowItem">Dane szczegółowe</span> obok nazwy obiektu, aby zobaczyć szczegółową analizę wartości odstających w tym obiekcie.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Uwaga\\:</span>Ustalenie <span class\\="xis-windowItem">Wartości odstające</span> rozpoznaje wszystkie wartości odstające w źródłach danych, nawet jeśli twoje obiekty raportu wykluczają te wartości za pomocą filtrów lub rankingów.</div></section>',
