        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.Options.CrosstabRestartNumbers.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomSortEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aby wyeliminować niżej wymieniony problem, zmniejsz liczbę wartości w sortowaniach niestandardowych. Aby na przykład wyeliminować problemy o niskim priorytecie, zmniejsz liczbę wartości wybranych do sortowania niestandardowego do co najwyżej 25.</p><p class\\="xis-paragraph">Niski priorytet\\: zawiera &gt; 25 sortowań</p></section>',
        "vaeua-gui-eua.Properties.linearRegression.variableSelectionCriterion.help.tip.txt": "Dalsze informacje o tej opcji ",
