        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.color.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.generalizedAdditive.fConvValue.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.predAuto.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Rozszerza model o obserwacje z brakami danych. W przypadku czynników kategoryzujących podczas przeprowadzania analizy braki danych są traktowane jako osobny poziom. W przypadku czynników mierzalnych braki danych są używane do wyliczania wartości reguły podziału. Powstaje reguła podziału, która przypisuje braki danych do gałęzi, co maksymalizuje wartość podziału.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.auto_stop_method.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje kryterium przesunięcia danych walidacji, aby przerwać uczenie podczas lokalnie optymalnej iteracji.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.learningRate.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa metodę traktowania braków danych dla predyktorów. Dla odpowiedzi kategoryzującej braki danych są traktowane jako pełnoprawny poziom odpowiedzi.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCalculationCount.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.svm.customToleranceValue.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.Options.CrosstabRestartNumbers.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.cellWeight.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Odpowiada za sposób ważenia komórek w macierzy terminów wg dokumentów. Wagą komórki nazywamy funkcję stosowaną do każdego z wpisów macierzy terminów wg dokumentów celem osłabienia skutków powtarzania się terminu w dokumencie.</p></section>',
        "vaeua-gui-eua.Properties.generalizedAdditive.maxDf1d.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.ridge.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.models.usePartition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Dzieli dane na zbiór uczący i zbiór walidacyjny. Modele zbudowane dla danych uczących są weryfikowane na danych walidacyjnych dla zapobieżenia przeuczeniu.</p></section>',
        "vaeua-gui-eua.Properties.assessment.showAllPlots.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.pcPlot.nbins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje liczbę kubełków używanych dla każdej zmiennej mierzalnej podczas generowania wykresów polilinii w układzie współrzędnych równoległych. Większa liczba kubełków może spowolnić przetwarzanie wykresu.</p></section>',
        "vaeua-gui-eua.Properties.assessment.useDefaultNumberOfBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Używa domyślnej liczby kubełków do wyliczania statystyki lift. Wartością domyślną jest 20.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.variableSelection.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.glm.linkFunction.label.help.tip.txt": "Dalsze informacje o tej opcji ",
