        "vaeua-gui-eua.eventLevel.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje wartość przedstawiającej zdarzenie zmiennej odpowiedzi do wyliczania statystyk, między innymi krzywej ROC i liftu.</p></section>',
        "vaeua-gui-eua.Properties.assessment.numberOfBinsCategory.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje liczbę kubełków służącą do wyliczania statystyki liftu. </p></section>',
        "vaeua-gui-eua.Properties.bayesNet.maxParents.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.vote.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje, w jaki sposób obliczane są prawdopodobieństwa prognoz dla poziomów odpowiedzi. </p></section>',
        "vaeua-gui-eua.ReportDistribution.ChooseMicrosoftTeamsChannel.Available.help.tip.txt": "Dalsze informacje o tej opcji ",
