        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.pcPlot.maxPolylines.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa maksymalną liczbę polilinii generowanych przez algorytm współrzędnych równoległych. Zwiększenie tej wartości umożliwia bardziej szczegółową dyskretyzację.</p></section>',
        "vaeua-gui-eua.Properties.assessment.numberOfBinsCategory.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.lasso.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.linearTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Opcja <span class\\="xis-windowItem">Wyświetlanie wartości kresek</span> określa sposób umieszczenia wartości kresek na osi X. Można wybrać <span class\\="xis-windowItem">Automatycznie zmniejsz nakładanie</span> lub <span class\\="xis-windowItem">Stała orientacja</span>.</p><div class\\="xis-paragraph">Opcja <span class\\="xis-windowItem">Automatycznie zmniejsz nakładanie</span> jest stosowana tylko wtedy, gdy wartości kresek nachodzą na siebie. Można podać co następuje\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Odrzuć część</span></td><td>pominięcie samych wartości kresek.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Obrót o 45°</span></td><td>obraca wszystkie wartości kresek o 45 stopni.</td></tr></table></div>                 </div><div class\\="xis-paragraph">Opcja <span class\\="xis-windowItem">Ustalona orientacja</span> jest zawsze stosowana i ustawia orientację wartości. Można podać co następuje\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Poziomy</span></td><td>wyświetla wartości kresek podziałki w poziomie.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Obrót o 45°</span></td><td>obraca wszystkie wartości kresek o 45 stopni.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Obrócenie o 45 stopni, pochylenie</span></td><td>obraca wszystkie wartości kresek o 45 stopni, a następnie odrzuca niektóre wartości kresek.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.interactionEffect.complete.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.linearRegression.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Rozszerza model o obserwacje z brakami danych. Efekt ciągły jest uzupełniany średnią obserwowaną i tworzona jest zmienna wskaźnikowa ukazująca braki danych. Efekt klasyfikujący (nominalny) traktuje braki danych jako osobny poziom. </p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.bayesNet.markovBlanket.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.ManageSectionTemplates.saveDialog.localImageSize.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Zalecany rozmiar miniaturki to 288 x 160 pikseli.</p></section>',
        "vaeua-gui-eua.sas.van.interactionEffect.twoWay.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.predictorBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje liczbę kubełków predyktorów mierzalnych.</p></section>',
        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Ukazuje najczęściej lub najrzadziej zalecane kategorie dla wszystkich poszczególnych zmiennych kategoryzujących. Przed wybraniem predyktora należy przypisać przynajmniej jeden predyktor.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.standardizationMethodlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje metodę używaną do standaryzacji predyktorów mierzalnych.</p></section>',
        "vaeua-gui-eua.Properties.svm.maxSupportVectors.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.tip.txt": "Dalsze informacje o tej opcji ",
