        "vaeua-gui-eua.sas.van.Properties.object.title.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.svm.customToleranceValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje wartość tolerancji dla zbieżności. </p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.scatterplot.overviewAxisCannotBeShown.multipleMeasurePairs.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.react.sas.van.views.layout.panels.Properties.geo.cluster.color.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.va.displayRule.alertsDisabled.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.predAuto.showSubgroups.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.partialdependence.numObs.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.leafSize.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.bayesNet.naive.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.splittingCriterion.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje, ile skupień należy utworzyć lub podaje, że dla uzyskania optymalnej liczby skupień należy użyć metody ABC.</p><p class\\="xis-paragraph">Metoda ABC najpierw wybiera, ile trzeba utworzyć skupień, tworzy je i wylicza dla każdego z nich statystyki odstępu. Następnie tworzony jest rozkład odniesienia, zorientowany wokół każdego poszczególnego skupienia, i wyliczana jest statystyka odstępu dla każdego z rozkładów odniesienia. Proces jest powtarzany dla wszystkich potencjalnych liczb skupień. Jako optymalna liczba skupień wybierana jest liczba skupień maksymalizująca całkowitą różnicę między statystykami odstępu skupień a danych odniesienia.</p><p class\\="xis-paragraph">Metoda ABC jest prawidłowa tylko gdy wszystkie dane wejściowe to zmienne miary.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.neuralnetwork.l1.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Używa domyślnej liczby predyktorów dla każdego podziału. Wartością domyślną jest pierwiastek kwadratowy z łącznej liczby predyktorów. Możesz jednak podać liczbę predyktorów dla każdego z podziałów.</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje liczbę kubełków używanych do kategoryzacji zmiennych mierzalnych na wykresie zależności cząstkowej.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Włącza szybki algorytm klastrowania k-średnich i ignoruje kolejność kubełków. Opcji tej nie wybieraj, jeśli chcesz użyć zachłannego algorytmu wyszukiwania i zachować kolejność kubełków. Odpowiedzi mierzalne niezdyskretyzowane używają jako kryterium wyboru wariancji. Kiedy opcja jest zaznaczona, odpowiedzi kategoryzujące (nominalne) i zdyskretyzowane odpowiedzi mierzalne (przedziałowe) korzystają z kryterium współczynnika zysku. W przeciwnym wypadku używany jest zysk bezwzględny.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.includePartsOfSpeech.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.svm.defaulttolerance.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.barSpacing.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Próbuje utworzyć naiwną sieć bayesowską i wspomaganą naiwną sieć bayesowską. Naiwna sieć bayesowska podaje, że zmienna odpowiedzi jest jedynym elementem nadrzędnym dla wszystkich predyktorów. Przyjmuje warunkową niezależność od wszystkich predyktorów, biorąc pod uwagę zmienną odpowiedzi. Naiwna zmodyfikowana sieć bayesowska, rozszerza sieć naiwną, poprzez zezwolenie węzłom predykcyjnym na utworzenie sieci bayesowskiej.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.bayesNet.markovBlanket.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.ReportReview.LongRunningQueries.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.generalizedAdditive.maxDf2d.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.ReportReview.HighCalculationCount.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje względną liczbę wyliczanych społeczności (lokalnych zgrupowań węzłów). Społeczności są aktualizowane dynamicznie wraz ze zmianami w sieci.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.factMac.nonnegativeFactorization.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Wymusza nieujemne czynniki z wyrazami obciążenia ustawionymi jako zero. Może to poprawić wydajność, gdy dane uczenia są bardzo skąpe.</p></section>',
