        "vaeua-gui-eua.Properties.svm.defaultiteration.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje poziom dostosowania, jakie każdy użytkownik może wprowadzić do swojego widoku raportu. Każdy z poziomów zawiera w sobie poziomy leżące niżej.</p></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Generuje niestandardowe znaczniki HTML-owe, tak by obiekt lub raport można było osadzić na stronie internetowej.</p><p class\\="xis-paragraph">Aby włączyć na swojej stronie internetowej znaczniki niestandardowe, należy dodać do nagłówka strony znaczniki &lt;script&gt;. Więcej informacji o osadzaniu zawartości SAS Visual Analytics znajdziesz w <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">dokumentacji SDK SAS Visual Analytics</a>.</p></section>',
        "vaeua-gui-eua.clusterSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Opcja <span class\\="xis-windowItem">Odległość skupień od siebie</span> kontroluje szerokość odstępu pomiędzy skupieniami zgrupowanych słupków. Jeśli chcesz zmienić odstęp między słupkami, ustaw opcję <span class\\="xis-windowItem">Odstęp</span>.</p></section>',
        "vaeua-gui-eua.AutoCustomCategoryPanel.categoryType.help.content.txt.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Typ grupy <span class\\="xis-windowItem">Wartości unikatowe</span> jest dostępny tylko dla miar o niewielkiej liczbie wartości unikatowych.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.responseBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje liczbę kubełków służących do kategoryzowania odpowiedzi mierzalnej.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.cellWeight.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruneWithValidationData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Tworzy drzewo decyzyjne za pomocą danych uczących i przycina je za pomocą algorytmu kosztów i złożoności zastosowanego do danych walidacyjnych.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.tip.txt": "Dalsze informacje o tej opcji ",
