        "vaeua-gui-eua.Properties.bayesNet.chooseBestNumParents.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Buduje określone struktury sieciowe, powtarzając liczbę elementów nadrzędnych od 1 do wartości maksymalnej ich liczby. Wybrano sieć z najlepszym odsetkiem błędnych klasyfikacji.</p></section>',
        "vaeua-gui-eua.react.va.geo.search.pinLocation.help.tip.txt": "Dalsze informacje o tej opcji ",
