        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.table.detailData.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.predAuto.sensitivityToExtremeValues.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje stopień czułości używany do identyfikowania wartości ekstremalnych. Wyższe ustawienie czułości zazwyczaj identyfikuje jako ekstrema więcej wartości.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.groupingScale.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa, że użytkownicy pomijają ekran logowania i automatycznie korzystają z poświadczeń gościa. W przypadku użytkowników zalogowanych z poświadczeniami gościa stan wyświetlania nie przechodzi z sesji na sesję i preferencje użytkownika nie są dostępne.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.maxLevels.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje maksymalną głębokość drzewa decyzyjnego, gdzie węzeł główny stanowi poziom 1.</p></section>',
        "vaeua-gui-eua.Properties.linearRegression.variableSelection.maximumEffects.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
