        "vaeua-gui-eua.barLabelFitPolicy.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.learning_rate.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa tempo uczenia. Im wolniejsze uczenie, tym łatwiej uniknąć przeuczenia modelu.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.allowNeuronDirectConnect.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterTwo.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa maksymalną wartość początkową (górna granica) dla elementu sterującego. Wartość początkowa jest wybierana przy pierwszym otwarciu raportu przez użytkownika lub gdy użytkownik wybierze <span class\\="xis-windowItem">Przywróć domyślny stan raportu</span>. </p><div class\\="xis-paragraph">Wprowadź wartość w polu tekstowym lub podaj jedną z następujących opcji\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatycznie</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">określa, że wybór zostanie zapisany jako wartość początkowa podczas zapisywania raportu. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Wartość maksymalna</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">określa, że najwyższa wartość w elemencie sterującym jest wartością początkową.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">nazwa-parametru</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">określa, że wartość wybranego parametru jest wartością początkową elementu sterującego.</p><p class\\="xis-paraSimple">Można wybrać parametr tylko wtedy, gdy istnieje już parametr o odpowiednim typie danych.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Określa, w jaki sposób ruch drogowy jest używany do obliczania czasu podróży dla elementu graficznego. Wybierz jedną spośród następujących opcji\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Nie</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Określa, że obliczanie czasu podróży wykorzystuje średnią ważoną historycznych danych o ruchu dla wszystkich pór dnia i dla wszystkich dni tygodnia.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Bieżący ruch drogowy</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Określa, że obliczanie czasu podróży wykorzystuje aktualne warunki drogowe. Te dane o ruchu drogowym można zaktualizować, klikając <span data-icon-name\\="refresh" alt\\="ikonę Aktualizuj dane o ruchu drogowym" aria-label\\="ikonę Aktualizuj dane o ruchu drogowym"></span>. Gdy użytkownik przegląda raport, ruch nie jest aktualizowany automatycznie. Użytkownik musi zaktualizować dane o ruchu drogowym, aby odzwierciedlić najnowsze warunki ruchu.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Typowy ruch drogowy</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> określa, że do obliczenia czasu podróży używany jest typowy ruch drogowy w określonym czasie i dniu tygodnia. Typowe warunki drogowe są oparte na najnowszych danych historycznych.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Uwaga\\:</span> Określony czas jest czasem lokalnym dla lokalizacji na mapie.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Uwaga\\:</span>Pobieranie danych o czasie podróży zużywa kredyty usług premium Esri.</div><div class\\="xis-note"><span class\\="xis-noteGenText">Uwaga\\:</span>Jeśli dla obszaru zawierającego obliczenie czasu podróży nie są dostępne żadne dane o ruchu drogowym, do obliczenia czasu podróży używane są podane ograniczenia prędkości.</div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.extractNounGroups.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
