        "vaeua-gui-eua.sas.van.splineEffect.twoWay.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Efekty złożone z każdej poszczególnej pary wybranych elementów. Ten efekt wymaga przynajmniej dwóch elementów.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Wybierz zmienną do podzielenia węzła. Zmienne są sortowane według wartości logarytmicznej, mierzącej skuteczność, z jaką dana zmienna dzieli dane. Wartość logarytmiczna jest ujemnym logarytmem wartości p z testu chi-kwadrat.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.scatterplot.overviewAxisCannotBeShown.multipleMeasurePairs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Wyświetla podgląd osi.</p><p class\\="xis-paragraph">Ta opcja nie jest dostępna, jeśli więcej niż dwa elementy są przypisane do wykresu.</p></section>',
