        "vaeua-gui-eua.Properties.svm.defaultiteration.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa domyślną maksymalną liczbę iteracji do zatrzymania procesu dopasowywania modelu. Domyślną wartością jest 25.</p></section>',
        "vaeua-gui-eua.Properties.svm.defaulttolerance.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Wybierz, aby użyć domyślnej minimalnej tolerancji bezwzględnej, przy której zatrzymuje się iteracja. Domyślną wartością jest 1.0E-6.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aby wyeliminować niżej wymieniony problem, usuń elementy sterujące z obszaru podpowiedzi strony. Aby na przykład wyeliminować problemy o średnim priorytecie, zmniejsz liczbę elementów sterujących na obszarze podpowiedzi strony do co najwyżej 10.</p><p class\\="xis-paragraph">Średni priorytet\\: zawiera &gt; 10 obiektów na obszarze podpowiedzi strony.</p></section>',
        "vaeua-gui-eua.va.displayRule.alertsDisabled.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.react.sas.van.views.layout.panels.Properties.geo.cluster.color.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Koloruje skupienia na podstawie wartości danych w skupieniu. Jeżeli rola danych <span class\\="xis-windowItem">Kolor</span> nie została przypisana, wówczas opcja nie daje efektów.</p></section>',
