        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Używa tylko predyktorów, które są zależne od zmiennej odpowiedzi pod podaną statystyką testu niezależności.</p></section>',
