        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.color.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Koloruje skupienia na podstawie wartości danych w skupieniu. Ta opcja jest dostępna tylko wtedy, gdy przypisano rolę danych <span class\\="xis-windowItem">Kolor</span>.</p></section>',
