        "vaeua-gui-eua.sas.van.ReportReview.HighCalculationCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aby wyeliminować niżej wymieniony problem, usuń wyliczenia. Aby na przykład wyeliminować problemy o niskim priorytecie, zmniejsz liczbę wyliczeń w raporcie do co najwyżej 14.</p><p class\\="xis-paragraph">Niski priorytet\\: zawiera &gt;\\= 15 obliczeń</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.linkType.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.partialdependence.numObs.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.generalizedAdditive.maxDf2d.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje maksymalną liczbę stopni swobody dla dwuwymiarowych efektów krzywej składanej.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.variableSelection.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Testuje każdy z predyktorów warunkowej niezależności zmiennej odpowiedzi od dowolnego innego predyktora w podanej statystyce testu niezależności. Zaznaczenie opcji <span class\\="xis-windowItem">Wybór zmiennych</span> powoduje odrzucenie predyktorów, które są warunkowo niezależne od zmiennej odpowiedzi, z uwzględnieniem dowolnego innego predyktora.</p></section>',
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.leafSize.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.assessment.cutoff.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa prawdopodobieństwo graniczne prognozy, decydujące, czy obserwacja jest zdarzeniem dla modelu.</p></section>',
        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aby uniknąć zagnieżdżenia kontenerów i wyeliminować niżej wymienione problemy, skoryguj układ raportu. Aby na przykład wyeliminować problemy o wysokim priorytecie, sprawdź czy na układzie raportu nie występuje więcej niż 6 kontenerów zagnieżdżonych.</p><p class\\="xis-paragraph">Niski priorytet\\: zawiera &gt; 2 kontenery zagnieżdżone</p><p class\\="xis-paragraph">Średni priorytet\\: zawiera &gt; 4 kontenery zagnieżdżone</p><p class\\="xis-paragraph">Wysoki priorytet\\: zawiera &gt; 6 kontenerów zagnieżdżonych</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
