        "vaeua-gui-eua.Properties.linearRegression.variableSelectionType.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa metodę wybierającą najlepszy zbiór efektów modelu z efektów przypisanych w okienku Role.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.annealingRate.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa współczynnik wyżarzania używany do optymalizacji SGD. Wartość niezerowa ułatwia osiągnięcie zbieżności przy lokalnym minimum funkcji celu.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje, czy terminy są klasyfikowane jako części mowy, i czy rozpoznawane są grupy rzeczownikowe i obiekty tekstowe.</p></section>',
