        "vaeua-gui-eua.Properties.predAuto.showSubgroups.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa, czy wyliczać grupy i czy wyświetlać w rezultatach trzy najlepsze i trzy najgorsze grupy. Dla podanej zmiennej odpowiedzi uruchamiane są drzewa decyzyjne, a z każda z grup opisuje element liściowy jednego z tych drzew.</p></section>',
