        "vaeua-gui-eua.Properties.logisticRegression.gradientConversion.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje kryterium zbieżności składowych gradientu maksymalnego.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa maksymalny błąd walidacji umożliwiający zakończenie uczenia modelu. Kiedy błąd walidacji jest mniejszy od podanej wartości docelowej, uczenie modelu ulega przerwaniu.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.tip.txt": "Dalsze informacje o tej opcji ",
