        "vaeua-gui-eua.discreteTickValueFitPolicy.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Distribution.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa funkcji rozkładu służącego do modelowania zmiennej odpowiedzi.</p></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Opcja <span class\\="xis-windowItem">Rotacyjne zmiany stylu elementów danych</span> podaje sposób przypisania stylów do elementów danych w szablonie wykresu. Na przykład na wykresie liniowym opcja ta podaje, w jaki sposób kolory, rodzaje linii i znaczniki są używane do odróżniania od siebie linii na wykresie. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatycznie</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">używa ustawienia rotacji stylów pochodzącego z motywu. Większość motywów SAS-owych używa ustawienia <span class\\="xis-windowItem">Najpierw rotacja kolorów</span>. Motyw Wysoki kontrast używa ustawienia <span class\\="xis-windowItem">Rotacja wszystkich atrybutów</span>.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Najpierw rotacja kolorów</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">wyświetla wypełnienie pełne, linię ciągłą i spójny kształt znaczników, dopóki nie zostaną użyte wszystkie kolory z palety.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Rotacja wszystkich atrybutów</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">oprócz tego, że wyświetla różne kolory, wyświetla też różne desenie wypełnienia, rodzaje linii i kształty znaczników. Ustawienie może ułatwiać dostępność użytkownikom niepełnosprawnym nierozróżniającym kolorów (daltonizm).</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterOne.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Określa parametr skali (współczynnik) w funkcji sigmoidalnej.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communities.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje liczbę społeczności (lokalne zgrupowania węzłów) wyliczaną dla poszczególnych skupień węzłów. Zwróć uwagę, że łączna liczba wyliczanych społeczności może być mniejsza od wybranej wartości, w zależności od struktury i rozmiaru sieci.</p></section>',
        "vaeua-gui-eua.Properties.logisticRegression.functionConversion.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
