        "vaeua-gui-eua.glm.linkFunction.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje funkcję łączącą służącą do powiązania uogólnionego modelu liniowego z rozkładem zmiennej odpowiedzi.                 </p></section>',
        "vaeua-gui-eua.barLabelFitPolicy.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.extractNounGroups.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.bayesNet.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Predyktory kategoryczne traktują braki danych jako odrębną wartość. Ciągły predyktor zastępuje brak danych średnią predyktora. W przypadku sieci bayesowskich braki danych nie są uwzględniane w zmiennej odpowiedzi.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.tip.txt": "Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Opcja <span class\\="xis-windowItem">Skala grupowania</span> określa sposób skalowania grupowanych wykresów słupkowych. Słupki mogą być nakładane na siebie lub łączone w grupy. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Wartości faktyczne</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">określa rozmiary słupków na podstawie wartości z danych. Przypuśćmy na przykład, że słupek z jednej grupy ma wartość 50 a słupek z drugiej grupy ma wartość 500. Słupek 500 będzie 10 razy wyższy od słupka 50.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Normalizuj grupy do 100%</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">przedstawia grupy korzystając ze skali względnej. W grupie każdy słupek jest wyświetlany jako procent grupy. Załóżmy na przykład, że grupa ma łączną wartość 100. Jeżeli słupek w tej grupie ma wartość 50, będzie miał wysokość odpowiadającą 50% całej grupy.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Opcja nie jest dostępna, gdy obiekt wykresu zawiera nałożone elementy wykresu. Nie jest również dostępna, jeśli na siatce określono ten sam zakres danych dla osi.</p></section>',
        "vaeua-gui-eua.connectOrder.help.aria.txt": "Pomoc. Dalsze informacje o tej opcji ",
        "vaeua-gui-eua.properties.sankey.linkColor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Nadaje kolory połączeniom na podstawie ścieżek, do których należą, zdarzeń, od których wychodzą, lub na podstawie tego, czy są porzuconymi połączeniami.</p></section>',
