        "vaeua-gui-eua.Properties.linearRegression.variableSelection.maximumEffects.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Podaje maksymalną liczbę efektów, które mogą znajdować się w modelu podczas dowolnej iteracji procesu wyboru.                 </p></section>',
